exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper}=await require("transcode/parse_catalog"),url=`https://www.duquanben.com/xiaoshuo/${bid.idPrefix()}/${bid}/`;return parseCatalog(url,{cleaner:html=>cleanCatalogWrapper(html,/class="mulu_list"[^>]*>/,"</ul>"),recordRegex:/href="(?<url>[^"]+)"[^>]*>(?<name>[^<]+)</g},{clientOptions:{...(options&&options.clientOptions)}})};